const Register = () => {
  // ./mill-eye-icon.png
  return (
    <Layout style={{backgroundColor: 'silver'}}>
      <Row justify="center" align="middle" >
        <Col span={10}>
          <div>WellCome to Yuco</div>
          <small>New Yugioh community...</small>
          <Button>More</Button>
        </Col>
        <Col span={10}>
            <img src={`./mill-eye-icon.png`}/>
          <Card title={<h1>REGISTER ACCOUNT</h1>}>
            <div>tets</div>
          </Card>
        </Col>
      </Row>
    </Layout>
  );
};
export default Register;
